import React from 'react';
import { Card } from 'antd';
import './App.css';

class SuggestionsCard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            amountSell: 0.0,
            exchangeSell: 0.0,
            amountBuy: 0.0,
            exchangeBuy: 0.0
          };
      }

    componentDidMount() {
        const req = new Request(this.props.url, {
            method: 'GET',
            cache: 'default'
          });
    fetch(req,
    {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }

      })
      .then((response) => {
          return response.clone().json()
        }
          )
      .then((data) => {
        this.setState({
            amountSell: data["amountSell"],
            exchangeSell: data["exchangeSell"],
            amountBuy: data["amountBuy"],
            exchangeBuy: data["exchangeBuy"]
            });
        })

    }

    render() {
        const { amountSell, exchangeSell, amountBuy,exchangeBuy} = this.state

            return (
            <div className="insideCard">
                <Card title="Best Selling Price">
                    <p>
                    <b>Exchange:</b>{exchangeSell}
                    <br />
                    <b>Price:</b>{amountSell} 
                    <br />
                    </p>
                </Card>
                <Card title="Best Buying Price">
                    <p>
                    <b>Exchange:</b>{exchangeBuy}
                    <br />
                    <b>Price:</b>{amountBuy} 
                    <br />
                    </p>
                </Card>
            </div>
            );
            }
    }

export default SuggestionsCard;
